import imgProjectNoprob from '../../assets/noprob.png'
import {useState} from 'react'
import ListBuild from './listBuild';
const Card = (props) => {
    const [open, setopen] = useState(false);
    const dataProjects = [
        {id:1, imgProject:imgProjectNoprob, title:'Noprob', description:'Lorem ipsum dolor sit amet consectetur adipisicing elit.'}
    ]
    return (
        <div className="bg-white rounded h-fit hover:drop-shadow-[0_2px_6px_rgba(0,188,154,0.7)] mb-5 sm:mx-2 w-full sm:w-[45%] md:w-[45%] lg:w-[30%] xl:w-[22%] transition-all duration-500">
            {
                dataProjects.maps((dataProject) => (
                    <div>
                        <div>
                <img src={imgProjectNoprob} className="rounded" alt='Photo Project' />
            </div>
            <hr/>
            <div className='pt-6 px-4 md:px-4'>
                <h1 className="font-medium text-xl">Project Name</h1>
                <p className="text-gray-400 pt-2 text-md font-normal">Lorem ipsum dolor sit amet consectetur adipisicing elit.</p>
                <div className='text-center text-3xl pt-2 pb-2'>
                    <span className="cursor-pointer" onClick={()=>setopen(!open)}>
                        <ion-icon name={`${!open ?'arrow-down-circle-outline': 'arrow-up-circle-outline'}`}/>
                    </span>
                </div>
                <div className={`mt-[-10px] pb-6 ${!open? 'hidden':''}`}>
                    <h4 className='font-medium'>Build with:</h4>
                    <ListBuild no={0}/>
                </div>
            </div>
                    </div>
                ))
            }
        </div>
    )
}
export default Card;
